var zhTW={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"允許","Allow in your wallet":"允許在你的錢包裡","Allow {symbol} first":["先允許 ",["symbol"]],"Allowance pending":"待定津貼","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"嘗試執行此兌換時發生錯誤。您可能需要增加滑點限制。如果還是不行，則可能是您正在交易的代幣與Uniswap不兼容。注：Uniswap V3不兼容轉賬時帶扣除費用（fee-on-transfer）的代幣和彈性供應（rebase）代幣。","Approval pending":"等待批准","Approve":"批準","Approve Permit2":"Approve Permit2","Approve in your wallet":"在您的錢包中批准","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["先批准 ",["symbol"]],"Auto":"自動","Auto Router":"自動路由","Auto Router API":"自動路由 API","Balance:":"余額：","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"關閉","Confirm in your wallet":"在你的錢包中確認","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"連接錢包","Connecting…":"連接…","Continue":"Continue","Convert {0} to {1}":["將 ",["0"]," 轉換為 ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"斷開錢包","Dismiss":"關閉","Enter an amount":"輸入數額","Error fetching trade":"獲取交易時出錯","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"正在獲取最優兌換率...","Get support":"獲取支援","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"高滑點增加了價格變動的風險","I don't have a wallet":"我沒有錢包","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":[["0"]," 餘額不足"],"Invalid recipient":"無效的接收方","Max":"最大值","Max slippage":"最大滑點","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"缺少依賴套件","Network fee":"網絡費用","No results found.":"未找到任何結果。","No tokens are available on this network. Please switch to another network.":"此網絡上沒有可用的令牌。請切換到另一個網絡。","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"請輸入有效的滑點百分比","Powered by the Uniswap protocol":"由 Uniswap 協議提供支持","Price impact":"兌換率影響","Price updated":"兌換率已更新","Reload":"Reload","Reload the page":"重新加載頁面","Request rejected":"Request rejected","Review swap":"審查交換","Search by token name or address":"按代幣名稱或地址搜索","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"出問題了","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"成功","Swap":"兌換","Swap failed: {0}":["兑换失败： ",["0"]],"Switch network":"切換網絡","Switch network in your wallet":"在您的錢包中切換網絡","Switching network":"交換網絡","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"兌換交易不滿足 Uniswap 不變量 X × Y = K 的要求。這通常意味著您要兌換的代幣之一在代幣轉賬過程中帶有一些自定義代幣合約特性。","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"輸入和輸出金額的美元價值之間的估計差異。","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"輸入代幣無法進行轉賬。輸入代幣可能有些問題。","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"輸出代幣無法進行轉賬。輸出代幣可能有些問題。","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"輸出代幣無法進行轉賬。輸出代幣可能有些問題。註：轉賬時帶扣除費用（fee-on-transfer）的代幣和會自動重新定價（rebase）的代幣都與Uniswap V3不相容。","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"由於兌換率變動，該交易將不會成功。請嘗試增加滑點容差。註：轉賬時帶扣除費用（fee-on-transfer）的代幣和會自動重新定價（rebase）的代幣都與Uniswap V3不兼容。","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"由於兌換率變動或代幣帶有轉賬時的扣除費用（fee-on-transfer），該交易將不會成功。請嘗試增加滑點容差。","This transaction will result in a":"This transaction will result in a","Transaction deadline":"交易截止期限","Transaction rejected":"交易被拒絕","Transaction submitted":"交易已提交","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"嘗試增加滑點容差。<0/>註：轉賬時帶扣除費用（fee-on-transfer）的代幣和會自動重新定價（rebase）的代幣都與Uniswap V3不相容。","Unexpected error. Could not estimate gas for the swap.":"錯誤。無法估計兑换所需的 gas。","Unexpected issue with estimating the gas. Please try again.":"估計 gas 時遇到問題。請再試一次。","Use the Uniswap Labs API to get faster quotes.":"使用 Uniswap Labs API 獲得更快的報價。","View on Etherscan":"在Etherscan上查看","Wallet disconnected":"Wallet disconnected","Warning":"警告","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"如果您的交易待處理的時間超過此時間段，交易將恢復。","Your transaction will revert if the price changes unfavorably by more than this percentage.":"如果兌換率變動超過此百分比，則將還原該交易。","minutes":"分鐘","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," 費用"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { zhTW as default };
